import React from "react";
// import { useSelector } from "react-redux";
import { get, isEmpty } from "lodash";

function PageComponent(props) {
  // const order = useSelector();

  const { userDetails, companyDetails } = props;
  const avatar = get(userDetails, "home.avatar") || "";
  const firstName = get(userDetails, "home.first_name") || "";
  const lastName = get(userDetails, "home.last_name") || "";
  const companyName = get(companyDetails, "home.company") || "";
  const companyUrl = get(companyDetails, "home.url") || "";

  const navigationHandler = () => {
    window.open(companyUrl);
  };

  return (
    <div>
      <img src={avatar} alt="" />
      <h2>First Name: {firstName}</h2>
      <h2>Last Name: {lastName}</h2>
      <h2>Company Name: {companyName}</h2>
      <button onClick={navigationHandler}>Link</button>
    </div>
  );
}

export default PageComponent;
